import React from "react";
import "./VideoTracker.css"; // Assurez-vous que le chemin est correct

const Banner = () => {
  return (
    <header className="banner">
      <div className="banner-content">
        {/* Conteneur pour le titre et le sous-titre */}
        <div className="banner-text">
          <h1 className="banner-title">Sales Tracker</h1>
          <p className="banner-subtitle">Track sales of stores and products</p>
        </div>

        {/* Conteneur séparé pour les boutons, permettant un alignement à droite */}
        <div className="banner-buttons">
          <button className="banner-button">Start Tracking</button>
          <button className="banner-button">Learn More</button>
        </div>
      </div>
    </header>
  );
};

export default Banner;
